import React from "react";
import Layout from '../../components/Layout'

const Home = (props) => {
    return(
        <div class="jumbotron">
            <Layout>
            <h1>Welcome to Admin Dashboard</h1>
            </Layout>
        </div>
    )
}

export default Home
